  14,\n\t\"tags\": [],\n\t\"title\": \"Ocean water temperature from data loggers from
  the HALE-ALOHA Moorings in the North Pacific Ocean as part of the Joint Global Ocean
  Flux (JGOFS), the World Ocean Circulation Experiment (WOCE), and Hawaii Ocean Time-series
  (HOT) from 24 April 1998 to 03 May 1999 (NODC Accession 9900212)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 4,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-12-20T18:32:27.954175\",\n\t\"name\": \"ocean-water-temperature-from-data-loggers-from-the-hale-aloha-moorings-in-the-north-pacific-oce\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Ocean water temperature data were collected
  from data loggers attached to the HALE-ALOHA Moorings in the North Pacific Ocean
  from 24 April 1998 to 03 May 1999. Data were collected by from the University of
  Hawaii at Manoa (UHM) as part of the Joint Global Ocean Flux (JGOFS), the World
  Ocean Circulation Experiment (WOCE), and Hawaii Ocean Time-series (HOTS).nnThe data
  logger employs 10 thermisters at approximately 2, 42, 53, 60, 80, 90, 100, 120,
  130 & 150m. The data files are in the format outputted by the manufacturers' software.
  After various lines of header, the data will be grouped by day. There will be 5
  lines of data. The first 4 lines will have 10 values while the last will have 8.
  In total, there will be 48 values. This corresponds with 1 data point for every
  half-an-hour.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
